<h1 mat-dialog-title>Errores en formulario</h1>
<div mat-dialog-content>
  <li *ngFor="let error of data.err">{{error.msg}}</li>
</div>
<div mat-dialog-actions align="end">
  <button mat-raised-button color="accent" (click)="onNoClick()">Cerrar</button>
</div>
<mat-drawer-container class="example-container" autosize>
  <mat-drawer #drawer class="example-sidenav" mode="over">
    <mat-card class="example-card">
      <mat-card-header>
        <mat-card-title>Inicio de Sesión con tu restaurante</mat-card-title>
        <mat-card-subtitle
          >Regístra tu restaurante si aún no lo has hecho!</mat-card-subtitle
        >
      </mat-card-header>
      <mat-card-content>
        <form [formGroup]="loginForm" (ngSubmit)="login()" id="loginForm">
          <div class="example-container">
            <mat-form-field appearance="fill">
              <mat-label>Introduce tu email</mat-label>
              <input
                autocomplete="off"
                type="email"
                formControlName="email"
                matInput
                placeholder="tuCorreo@dominio.com"
                required
              />
            </mat-form-field>
          </div>
          <br />
          <div class="example-container">
            <mat-form-field appearance="fill">
              <mat-label>Introduce tu contraseña</mat-label>
              <input
                autocomplete="off"
                type="password"
                formControlName="password"
                matInput
                [type]="hide ? 'password' : 'text'"
                required
              />
              <button
                type="button"
                mat-icon-button
                matSuffix
                (click)="hide = !hide"
                [attr.aria-label]="'Hide password'"
                [attr.aria-pressed]="hide"
              >
                <mat-icon>{{
                  hide ? "visibility_off" : "visibility"
                }}</mat-icon>
              </button>
            </mat-form-field>
          </div>
        </form>
      </mat-card-content>
      <mat-card-actions>
        <button
          mat-raised-button
          color="accent"
          type="submit"
          (click)="login()"
        >
          Iniciar Sesión con Restaurante
        </button>
        <button
          mat-raised-button
          color="accent"
          routerLink="/auth/registroRestaurante"
          routerLinkActive="active"
          ariaCurrentWhenActive="page"
        >
          Registrar restaurante
        </button>
      </mat-card-actions>
    </mat-card>
  </mat-drawer>

  <div class="example-sidenav-content">
    <button
      type="button"
      mat-raised-button
      color="primary"
      (click)="drawer.toggle()"
    >
      Iniciar Sesión con tu restaurante
    </button>
  </div>
</mat-drawer-container>
